import 'antd/dist/antd.min.css'
import React, { Component } from 'react'
import Subnav from './Subnav/index'
import Contents from './Contents/index'
import './index.css'
import { Route,Routes,Link } from 'react-router-dom';

export default class Home extends Component {
  render() {
    return (
      <div className="home">
        <div className="home-subnav">
          <ul className="home-subnav-left">
            {/* all */}
            <li><Link to="/Contents">全部</Link></li>
            {/* infoManage */}
            <li><Link to="/Contents">信息管理</Link></li>
            {/* rdDesign */}
            <li><Link to="/Contents">研发设计</Link></li>
            {/* productControl */}
            <li><Link to="/Contents">生产控制</Link></li>
            {/* Firmware */}
            <li><Link to="/Contents">嵌入式软件</Link></li>
          </ul>
          <div className="home-subnav-right">
            <input type="text" placeholder='搜索'/>
            <Button shape="circle" icon={<SearchOutlined />} />
          </div>
        </div>
        <Routes>
          <Route path="/Contents" element={<Contents/>}/>
        </Routes>
      </div>
    )
  }
}
